import React from 'react';

function ProgressComp(id) {
    return <div id={id}></div>;
}

function Main() {
    return (
        <main>
            <section id="progress">
                <ProgressComp name="first" />
                <div id="second"></div>
                <div id="third"></div>
            </section>
            <section id="controls"></section>
        </main>
    );
}

export default Main;
